import ExExpress

// CardDAV: low-hanging fruits!

func registerCardDAVMiddleware(in app: Express) {
  // MARK: - The addressbook itself

  app.proppatch("/todomvc/contacts") { req, res, _ in
    // fake, iCal tries to patch stuff - we don't care
    let s = try req.readBodyAsString()
    print("PROPPATCH:\n---\n\(s)\n---")
    res.writeHead(200, [ "Content-Type" : "text/xml" ])
    try res.end()
  }
  
  app.propfind("/todomvc/contacts") { req, res, _ in
    var responses = [ DAVResponse ]()
    responses.append(MakeResponse.forAddressbook(req, url: req.url))
    
    if req.depth != .Zero {
      // we just always send all three :-)
      responses.append(MakeResponse.forVCard(req, collectionURL: req.url,
                                             fn: "zz"))
      responses.append(MakeResponse.forVCard(req, collectionURL: req.url,
                                             fn: "noze"))
      responses.append(MakeResponse.forVCard(req, collectionURL: req.url,
                                             fn: "ari"))
    }
    try res.send(responses)
  }
  
  app.report("/todomvc/contacts") { req, res, _ in
    var responses = [ DAVResponse ]()
    
    // we just always send all three :-)
    responses.append(MakeResponse.forVCard(req, collectionURL: req.url,
                                           fn: "zz"))
    responses.append(MakeResponse.forVCard(req, collectionURL: req.url,
                                           fn: "noze"))
    responses.append(MakeResponse.forVCard(req, collectionURL: req.url,
                                           fn: "ari"))
    try res.send(responses)
  }
  
  
  // MARK: - The Contacts
  
  func vCardForFN(fn: String?) -> String? {
    guard let fn = fn else { return nil }
    switch fn {
      case "zz":   return builtinVCards.zz
      case "ari":  return builtinVCards.ari
      case "noze": return builtinVCards.noze
      default:     return nil
    }
  }
  
  app.get("/todomvc/contacts/:fn") { req, res, next in
    guard let vCard = vCardForFN(fn: req.params["fn"])
     else { return try res.sendStatus(404) }
    
    res.writeHead(200, [ "ETag"         : "\"ZzCardTag-\(baseTime)\"",
                         "Content-Type" : "text/vcard" ])
    try res.end(vCard)
  }
  
  app.put("/todomvc/contacts/:fn") { req, res, next in
    return try res.sendStatus(403)
  }
}

extension MakeResponse {
  
  static func forAddressbook(_ req: IncomingMessage, url: String) -> DAVResponse
  {
    let privileges = [ "all", "read" ]
    
    var r = DAVResponse(url: "/todomvc/contacts/", ns.DAV, [
      "displayname"                : .Text("TodoMVC Contacts"),
      "current-user-principal"     : .URL(defaultPrincipalURL),
      "principal-collection-set"   : .URL(principalCollectionURL),
      "owner"                      : .URL(defaultPrincipalURL),
      "current-user-privilege-set" : .TagSubset(ns.DAV, "privilege",privileges),
      "resourcetype"               : .TagArray([ ( ns.DAV,     "collection"  ),
                                                 ( ns.CardDAV, "addressbook" )])
    ], query: req.davQuery)
    
    r.add(ns.CardDAV, [ "supported-address-data" :
          .Raw("<address-data-type" +
               " xmlns=\"\(ns.CardDAV)\"" +
               " content-type=\"text/vcard\" version=\"3.0\" />")])
    
    let ctag = "\"zztag-\(baseTime)-cards\"" // immutable
    r.add(ns.CalServer, [ "getctag": .Text(ctag) ])
    
    return r
  }

  static func forVCard(_ req: IncomingMessage, collectionURL: String,
                      fn: String) -> DAVResponse
  {
    let privileges = [ "read-content" ]
    
    var r = DAVResponse(url: collectionURL + fn, ns.DAV, [
      "getetag"        : .Text("\"ZzCardTag-\(baseTime)\""),
      "getcontenttype" : .Text("text/vcard"),
      "current-user-privilege-set" : .TagSubset(ns.DAV, "privilege", privileges)
    ], query: req.davQuery)
    
    if let query = req.davQuery {
      if query.isPropertySelected(ns: ns.CardDAV, name: "address-data") {
        let data : String
        switch fn {
          case "zz":   data = builtinVCards.zz
          case "ari":  data = builtinVCards.ari
          case "noze": data = builtinVCards.noze
          default: data = ""
        }
        r.add(ns.CardDAV, [ "address-data": .Text(data) ])
      }
    }
    
    return r
  }
}

